import moment from "moment";
import { useState , useInterval} from "react";
function Clock(){

    const [time, setTime] = useState(moment().format('LT'))

    useInterval(
        setTime(moment().format('LT'))
    , 5000)

    return(
        <span>
            {time}
        </span>
    );
}

export default Clock;
